import React from 'react';
import Footer from '../components/Footer';
import ProfessionalsMain from '../components/ProfessionalsMain';
import CyberSecurityImage from '../assets/images/Cyber_Security2.jpg';
import ProfessionalsSection from '../components/ProfessionalsSection';
import SuggestionButtons from '../components/SuggestionButtons';

function CyberSecurity() {
  return (
    <>
      <ProfessionalsMain
        backgroundImage={CyberSecurityImage}
        title="Cyber Security Professionals"
        subtitle="We've carefully selected 50 professionals across five distinct occupations, 
        boasting a collective experience of over 1,000 years. Our team ensures cutting-edge expertise in each of these fields."
      />
      <ProfessionalsSection
        avatar1="https://randomuser.me/api/portraits/women/62.jpg"
      />
      <SuggestionButtons />
      <Footer />
    </>
  );
}

export default CyberSecurity;
